int main(void)
{
	
	// choose a random board
    srand(time(NULL)); 
    int board_choice = (rand() % 3) + 1; 

	for (int row = 0; row < 9; row++)
    {
        for (int col = 0; col < 9; col++)
        {
			if (board_choice == 2) {
				sudoku_game[row][col] = sudoku_game1[row][col];
				sudoku_updated[row][col] = sudoku_updated1[row][col];
				sudoku_answer[row][col] = sudoku_answer1[row][col];
			} else if (board_choice == 1) {
				sudoku_game[row][col] = sudoku_game2[row][col];
				sudoku_updated[row][col] = sudoku_updated2[row][col];
				sudoku_answer[row][col] = sudoku_answer2[row][col];
			} else {
				sudoku_game[row][col] = sudoku_game3[row][col];
				sudoku_updated[row][col] = sudoku_updated3[row][col];
				sudoku_answer[row][col] = sudoku_answer3[row][col];
			}
		}
	}
	
	// calculate some numbers for correct positioning
	int grid_dim = 9;
	int cell_size = 240 / grid_dim;
	int x_offset = (320 - (cell_size * grid_dim)) / 2; 
	int y_offset = (240 - (cell_size * grid_dim)) / 2; 

    for (int i = 0; i < 10; ++i)
    {
        prev_switch_states[i] = *switch_ptr & (1 << i);
    }

    /* Initialize pixel buffers */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1; // Set front buffer
    wait_for_vsync(); // Wait for the swap to complete
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // Clear screen

    /* Set back pixel buffer */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

    // Draw Sudoku grid
    for (int i = 0; i <= grid_dim; i++)
    {
		int x = x_offset + i * cell_size;
		int y = y_offset + i * cell_size;
		
		if (i % 3 == 0){ // blue so that the boxes are clear
			 draw_line(x, y_offset, x, y_offset + cell_size * grid_dim, 0x00FF); 
			 draw_line(x+1, y_offset, x+1, y_offset + cell_size * grid_dim, 0x00FF); 
			 draw_line(x_offset, y, x_offset + cell_size * grid_dim, y, 0x00FF); 
			 draw_line(x_offset, y+1, x_offset + cell_size * grid_dim, y+1, 0x00FF);
		} else { // white
			draw_line(x, y_offset, x, y_offset + cell_size * grid_dim, 0xFFFF);
        	draw_line(x_offset, y, x_offset + cell_size * grid_dim, y, 0xFFFF); 
		}
    }

    // Draw the Sudoku numbers on the board
    for (int row = 0; row < 9; row++)
    {
        for (int col = 0; col < 9; col++)
        {
            if (sudoku_game[row][col] != 0)
            {
                int x = x_offset + col * cell_size + 8;
                int y = y_offset + row * cell_size + 8;
                draw_number(x, y, sudoku_game[row][col], 0xFFFF);
            }
        }
    }
	
	// Draw the hearts
    for (int row = 0; row < 30; row++) {
        for (int col = 0; col < 30; col++) {
			if(heart[row][col] != 64888){ // ignore background colour
                plot_pixel(col + 7, row + 5, heart[row][col]);
				plot_pixel(col + 7, row + 37, heart[row][col]);
				plot_pixel(col + 7, row + 69, heart[row][col]);
				plot_pixel(col + 7, row + 101, heart[row][col]);
			}
        }
    }

    /* Copy buffer1 to buffer2 */
    for (int y = 0; y < 240; y++)
    {
        for (int x = 0; x < 320; x++)
        {
            Buffer2[y][x] = Buffer1[y][x];
        }
    }
	
	// keys edge capture register
	*(edge_cap) = 0x0000000F;

    // looping
    while (true)
    {

		// erase hearts
		if (hearts != 4){
			for (int row = 0; row < 30; row++) {
				for (int col = 0; col < 30; col++) {
					if(heart[row][col] != 64888){
						if (hearts == 3){
							plot_pixel(col + 7, row + 101, 0);
						}
						else if (hearts == 2){
							plot_pixel(col + 7, row + 69, 0);
						}
						else if (hearts == 1){
							plot_pixel(col + 7, row + 37, 0);
						}
						else if (hearts == 0){
							plot_pixel(col + 7, row + 5, 0);
						}
					}
				}
			}
			
		}

		// if you lose 
		if (hearts == 0){
			status = 'L';
			break;
		}
		
		// capture switch states and update leds
        for (int i = 0; i < 10; ++i)
        {
            switch_states[i] = *switch_ptr & (1 << i);
  
            if (prev_switch_states[i] == 0 && switch_states[i] == (1 << i))
            {
                led_states[i] = !led_states[i];
                *led_ptr = (led_states[i] << i); 
            }
        }
		
		// update previous 2 values of rows and columns
		prev2_row = prev_row;
		prev2_col = prev_col;
		prev_row = current_row;
		prev_col = current_col;

		// key 0 
        if ((*edge_cap) & 0x0001) {
            current_row = (current_row + 1) % 9;
            *(edge_cap) = 0x0001; // clear edge cap
        }
        // key 1 
        else if ((*edge_cap) & 0x0002) {
            current_col = (current_col + 1) % 9;
            *(edge_cap) = 0x0002; // clear edge cap
        }
        // key 2 
        else if ((*edge_cap) & 0x0004) {
            current_col = (current_col - 1 + 9) % 9;
            *(edge_cap) = 0x0004; // clear edge cap
        }
        // key 3 
        else if ((*edge_cap) & 0x0008) {
            current_row = (current_row - 1 + 9) % 9;
            *(edge_cap) = 0x0008; // clear edge cap
		}
		
		// poll the keyboard (referenced pg. 19, 20, and 56 of https://ftp.intel.com/Public/Pub/fpgaup/pub/Intel_Material/18.1/Computer_Systems/DE1-SoC/DE1-SoC_Computer_NiosII.pdf)
		bool num_pressed = false;
		int number = 0; 
		key_code = *ps2_ptr; 
		if (key_code != 0) { 
			int key = key_code & 0xFF; // lower 8 bits

			if (key == 0xF0) { // release code
				unpressed = true;
			} else if (unpressed) {
				switch (key) {
					case 0x16: 
						number = 1; 
						num_pressed = true;
						printf("1\n");
						break;
					case 0x1E: 
						number = 2; 
						num_pressed = true;
						printf("2\n");
						break; 
					case 0x26: 
						number = 3; 
						num_pressed = true;
						printf("3\n");
						break;  
					case 0x25: 
						number = 4; 
						num_pressed = true;
						printf("4\n");
						break;  
					case 0x2E: 
						number = 5; 
						num_pressed = true;
						printf("5\n");
						break;
					case 0x36: 
						number = 6; 
						num_pressed = true;
						printf("6\n");
						break; 
					case 0x3D: 
						number = 7; 
						num_pressed = true;
						printf("7\n");
						break; 
					case 0x3E: 
						number = 8;
						num_pressed = true;
						printf("8\n");
						break;  
					case 0x46: 
						number = 9; 
						num_pressed = true;
						printf("9\n");
						break; 
					case 0x66:
						number = 0;
						num_pressed = true;
						printf("Backspace pressed\n");
						break;
					case 0x6B:
						number = 11;
						current_row = (current_row - 1 + 9) % 9;
						printf("Left arrow pressed\n");
						break;
					case 0x74:
						number = 12;
						current_row = (current_row + 1) % 9;
						printf("Right arrow pressed\n");
						break;
					case 0x75: 
						number = 13;
						current_col = (current_col - 1 + 9) % 9;
						printf("Up arrow pressed\n");
						break;
					case 0x72:
						number = 14;
						current_col = (current_col + 1) % 9;
						printf("Down arrow pressed\n");
						break;
				}
				unpressed = false; // reset for next
			}
		}

		highlight_square(prev2_row, prev2_col, 0x0000); // clear previous
		highlight_square(current_row, current_col, 0x07E0); // highlight current
		
		int draw_x = x_offset + current_row * cell_size + 8;
		int draw_y = y_offset + current_col * cell_size + 8;
		
        // Draw the number
		if(num_pressed){
			if (sudoku_game[current_col][current_row] == 0) {
				sudoku_updated[current_col][current_row] = number;
				short int color;

				if (number==0) { // clear (backspace)
					color = 0x0000;
				}
				else if(number == sudoku_answer[current_col][current_row]){
					color = 0x07E0; // green (correct)
				}
				else {
					hearts -= 1;
					color = 0xF800; // red (incorrect)
				}

				draw_number(draw_x, draw_y, 8, 0); // clear prev number
				if (number != 0) {
					draw_number(draw_x, draw_y, number, color); // draw new number
				}
				
				// Wait for vertical sync
				wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1);
				
				draw_number(draw_x, draw_y, 8, 0); // clear prev number
				if (number != 0) {
					draw_number(draw_x, draw_y, number, color); // draw new number
				}
				
				hex_display(number); // display on hex
			}
	
		}
		else {
			for (int i = 0; i < 10; ++i)
			{
				if (switch_states[i] == (1 << i))
				{

					if (sudoku_game[current_col][current_row] == 0) {
						sudoku_updated[current_col][current_row] = i;
						short int color;

						if (i==0) {
							color = 0x0000;
						}
						else if(i == sudoku_answer[current_col][current_row]){
							color = 0x07E0; 
						}
						else {
							if(prev_switch_states[i] == 0){
								hearts -= 1;
							}
							color = 0xF800;
						}

						draw_number(draw_x, draw_y, 8, 0); 
						if (i != 0) {
							draw_number(draw_x, draw_y, i, color); 
						}
						hex_display(i);
						break; // break once switch found
					}
				}
			}
		}

        // Update previous switch states
        for (int i = 0; i < 10; ++i)
        {
            prev_switch_states[i] = switch_states[i];
        }
			
        // Wait for vertical sync
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

		// check for win and play sound 
		if (check_win()){
            status = 'W';
			//printf("%c", status);
			break;
		}
    }
	printf("end of game");
	
	// audio functionality from lab 6 and moshovos' notes
	if (status == 'W'){
        printf("you won!");
        int i;
        audiop->control = 0x8; // clear output FIFO
        audiop->control = 0x0;
        
        for (i = 0; i < 32782; i++){
            while (audiop->wsrc == 0);
            audiop->ldata = win_sound[i];
            audiop->rdata = win_sound[i];
        }
    }
    else if (status == 'L'){
		
        for (int row = 0; row < 30; row++) {
			for (int col = 0; col < 30; col++) {
				plot_pixel(col + 7, row + 5, 0);
			}
		}		
		
		// Wait for vertical sync
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		
		printf("you lose!");
        int i;
        audiop->control = 0x8; // clear output FIFO
        audiop->control = 0x0;
        
        for (i = 0; i < 29675; i++){
            while (audiop->wsrc == 0);
            audiop->ldata = lose_sound[i];
            audiop->rdata = lose_sound[i];
        }
    }
}

// Plot a pixel at (x, y) with color
void plot_pixel(int x, int y, short int color)
{
    volatile short int *one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = color;
}

// Highlight current row and column
void highlight_square(int row, int col, short int color){
	int cell_size = 240 / 9;
	int prev_row = 1;
	int prev_col = 1;
	
    int draw_x = row * cell_size + 34; 
    int draw_y = col * cell_size - 6; 
    
    // Draw the square with the specified color
    draw_line(draw_x + 10, draw_y + 10, draw_x + cell_size + 8, draw_y + 10, color); // Top 
    draw_line(draw_x + 10, draw_y + 10, draw_x + 10, draw_y + cell_size + 8, color); // Left 
    draw_line(draw_x + 10, draw_y + cell_size + 8, draw_x + cell_size + 8, draw_y + cell_size + 8, color); // Bottom 
    draw_line(draw_x + cell_size + 8, draw_y + 10, draw_x + cell_size + 8, draw_y + cell_size + 8, color); // Right 
}

// display number from 0 to 9 on hex display (based on page 56-57 of https://ftp.intel.com/Public/Pub/fpgaup/pub/Intel_Material/18.1/Computer_Systems/DE1-SoC/DE1-SoC_Computer_NiosII.pdf)
void hex_display(int number){
	int *HEX_BASE = (int *) 0xFF200020;
	volatile int * HEX_ptr = (int *)HEX_BASE;
	char seg7[] = {
		0x3f, // 0
		0x06, // 1
		0x5b, // 2
		0x4f, // 3
		0x66, // 4
		0x6d, // 5
		0x7d, // 6
		0x07, // 7
		0x7f, // 8
		0x67 // 9
		};
	
	*(HEX_ptr) = seg7[number];
}


// Clear the screen
void clear_screen()
{
    for (int x = 0; x < 320; x++)
    {
        for (int y = 0; y < 240; y++)
        {
            plot_pixel(x, y, 0);
        }
    }
}

// Swap two integer values
void swap(int *x, int *y)
{
    int temp = *y;
    *y = *x;
    *x = temp;
}

// Draw a line from (x0, y0) to (x1, y1) with color
void draw_line(int x0, int y0, int x1, int y1, short int color)
{
    bool is_steep = abs(y1 - y0) > abs(x1 - x0);
    if (is_steep)
    {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if (x0 > x1)
    {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;
    int y_step = (y0 < y1) ? 1 : -1;

    for (int x = x0; x <= x1; x++)
    {
        if (is_steep)
        {
            plot_pixel(y, x, color);
        }
        else
        {
            plot_pixel(x, y, color);
        }
        error += deltay;
        if (error >= 0)
        {
            y += y_step;
            error -= deltax;
        }
    }
}

// Wait for vertical synchronization
void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1; // Start the synchronization process
    while (*(pixel_ctrl_ptr + 3) & 0x01)
    {
    } // Polling loop waiting for S bit to go to 0
}

// Draw a number at a specific x and y location with a specific color 
void draw_number(int x, int y, int number, short int color)
{
	// bit patterns from course notes
	const int segments[10] = {
        0b1111110, // 0
        0b0110000, // 1
        0b1101101, // 2
        0b1111001, // 3
        0b0110011, // 4
        0b1011011, // 5
        0b1011111, // 6
        0b1110000, // 7
        0b1111111, // 8
        0b1111011  // 9
    };

    int pattern = segments[number];

	// draw a line for each segment where the bit is 1 in the pattern
    if (pattern & (1 << 6)) 
        draw_line(x, y - 5, x + 10, y - 5, color);
    if (pattern & (1 << 5))
        draw_line(x + 10, y -5, x + 10, y + 5, color); 
    if (pattern & (1 << 4))
        draw_line(x + 10, y + 5, x + 10, y + 15, color);
    if (pattern & (1 << 3))
        draw_line(x , y + 15, x + 10, y + 15, color);
    if (pattern & (1 << 2))
        draw_line(x , y + 5, x , y + 15, color);
    if (pattern & (1 << 1))
        draw_line(x , y - 5, x , y + 5, color);
    if (pattern & (1 << 0))
        draw_line(x , y + 5, x + 10, y + 5, color);
}

